import { 
  BrowserRouter as Router,
  Link,
  Route,
} from 'react-router-dom';

const Header = () => {
  return (
    <Route>
       <div className='App-header'>
        <div className='App-image'>
          <label>Image</label>
        </div>

        <div className='App-pages'>
          <Link to='/'>Home</Link>
          <Link to='/movies'>Movies</Link>
          <Link to='/tv-series'>TV Series</Link>
        </div>
      </div>
    </Route>

  )
}

export default Header;
